import { makeStyles } from "@mui/styles";

const BottomBarStyle = makeStyles({
    Bottom: {
        height: "100%",
        display: "flex",
        flexDirection: "row",
        margin: "1vh",
        alignItems: "center",
    }
});

export default BottomBarStyle;
